description:
A side-scrolling karate classic from 1984! The first game by the creator of Prince of Persia, Karateka arrives on Android with all the challenge and charm of the original Apple II experience. 

Fight as the lone hero to save the princess from the evil warlord Akuma. His relentless guards and pesky hawk will challenge your skill whether you remember the original, have played the remake, or are experiencing Karateka for the first time.

